import React, { useEffect, useState } from 'react';
import axios from 'axios';

import Budget from '../components/Budget';
import Method from '../components/Method';

export default () =>  {

    //RECORDS
    const [records, setRecords] = useState([]);

    //METHODS
    const [methods, setMethods] = useState([]);

    // Define the desired order of items
    const desiredOrder = ["Account", "Online CC", "Jobad CC", "Maddie CC", "Respaldo CC", "Amazon CC",  "PayPal CC", "Cash", "Savings", "Stock"];

    // Create a new array to store the reordered methods
    const reorderedMethods = [];

    // Define the state for the sum of amounts
    const [sumOfAmounts, setSumOfAmounts] = useState(0);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const recordsResponse = await axios.get('https://finanzas.visssible.com/backend/apartados-consultar.php');
                setRecords(recordsResponse.data);

                const methodsResponse = await axios.get('https://finanzas.visssible.com/backend/methods-consult.php');
                setMethods(methodsResponse.data);
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
    }, []); // The empty dependency array ensures that this effect runs once on mount

    // Calculate the real amount
    let realAmount = 0;
    if (reorderedMethods.length >= 5) {
        realAmount = (
            parseFloat(reorderedMethods[0].saldo) + (
                parseFloat(reorderedMethods[1].saldo) + 
                parseFloat(reorderedMethods[2].saldo) + 
                parseFloat(reorderedMethods[3].saldo) + 
                parseFloat(reorderedMethods[4].saldo)
            )
        ).toFixed(2);
    }

    // Use async/await to wait for the data to be fetched before processing
    useEffect(() => {
        const calculateSumOfAmounts = async () => {
            let sum = 0;
            for (const record of records) {
                if (record.budget === 1) {
                    sum += parseFloat(record.amount);
                }
            }
            setSumOfAmounts(sum);
        };

        calculateSumOfAmounts();
    }, [records]); // This effect runs whenever the records state changes


    // Iterate over the desired order and push matching items from the original array
    desiredOrder.forEach(name => {
        const method = methods.find(method => method.nombre === name);
        if (method) {
            reorderedMethods.push(method);
        }
    });

    return (
        <div id="principal" className='pantalla completa' style={{paddingBottom: '66px'}}>

            <ul id='methods'>

                {reorderedMethods.length > 0 && (
                    <li key="0" className="Account">
                        <i className="fas fa-money-check-alt"></i>
                        <div className="name">{reorderedMethods[0].nombre}</div>
                        <div className="amount">{reorderedMethods[0].saldo}</div>
                        <div className="realAmount">${realAmount}</div>
                    </li>
                )}

                <li id="balance">
                    <div className="founds"><i className="fas fa-wallet"></i> <span className="Label">Founds:</span> <span className="amount">$0</span></div>
                    <div className="budgets"><i className="fas fa-chart-pie"></i> <span className="Label">Budgets:</span> <span className="amount">${sumOfAmounts}</span> </div>
                    <div className="balance"><i className="fas fa-balance-scale"></i> <span className="Label">Balance:</span> <span className="amount">$0</span></div>
                </li>

                {reorderedMethods.slice(1).map((method, index) => (
                    <Method 
                        key={index} 
                        name={method.nombre} 
                        amount={method.saldo} 
                    />
                ))}
            </ul>

            <ul id='chart'></ul>

            <ul id="apartados">
                {records.map(record => (
                    <Budget 
                        key={record.id} 
                        name={record.nombre} 
                        amount={record.saldo} 
                        icon={record.icono} 
                        distribution={record.reparticion}
                    />
                ))}
            </ul>

        </div>
    );

}
